import React from 'react';
import { View } from 'react-native';

export default function App() {
  return (
    <View style={{
      backgroundColor: "#fff",
      flex: 1,
      flexDirection: 'column',
      justifyContent: 'center',
      alignItems: 'stretch',
    }}>
      <View style={{
        backgroundColor: 'dodgerblue',
        width: '100%',
        height: 100,
      }}/>
      <View style={{
        backgroundColor: 'gold',
        width: '100%',
        height: 100,
      }}/>
      <View style={{
        backgroundColor: 'tomato',
        width: '100%',
        height: 100,
      }}/>
    </View>
  ); 
}
